    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.data_lubs);

        db = openOrCreateDatabase("collection_db",MODE_PRIVATE, null);

        transinv = (Objects.requireNonNull(getIntent().getExtras()).getString("transinv"));
        DeptCode = (getIntent().getExtras().getString("DeptCode"));

        SaveCustomer();
        Toast.makeText(getApplicationContext(), "LUBS Customers have been successfully installed", Toast.LENGTH_LONG).show();

        InvoiceBalanceCategory();
        Toast.makeText(getApplicationContext(), "Invoice Balance Category Installed.", Toast.LENGTH_LONG).show();

        db.execSQL("UPDATE InstallValue SET Status = 'Y';");
        Toast.makeText(getApplicationContext(), "LUBS packages have been successfully installed", Toast.LENGTH_LONG).show();
        LubricantsData.this.finish();
    }

